gdh(){return"\u0b1f\u0b47\u0b15\u0b4d\u0b38\u0b1f\u0b4d \u0b2c\u0b1f\u0b28\u0b4d"},
glW(){return"\u0b0f\u0b15 \u0b1f\u0b47\u0b15\u0b4d\u0b38\u0b1f\u0b4d \u0b2c\u0b1f\u0b28\u0b15\u0b41 \u0b26\u0b2c\u0b3e\u0b07\u0b32\u0b47 \u0b15\u0b3e\u0b33\u0b3f\u0b30 \u0b1b\u0b3f\u0b1f\u0b3f\u0b15\u0b3e \u0b26\u0b47\u0b16\u0b3e\u0b2f\u0b3e\u0b0f \u0b15\u0b3f\u0b28\u0b4d\u0b24\u0b41 \u0b2c\u0b1f\u0b28\u0b4d \u0b09\u0b2a\u0b30\u0b15\u0b41 \u0b09\u0b20\u0b47 \u0b28\u0b3e\u0b39\u0b3f\u0b01\u0964 \u0b1f\u0b41\u0b32\u0b2c\u0b3e\u0b30\u0b30\u0b47, \u0b21\u0b3e\u0b0f\u0b32\u0b17\u0b30\u0b47 \u0b0f\u0b2c\u0b02 \u0b2a\u0b4d\u0b5f\u0b3e\u0b21\u0b3f\u0b02 \u0b38\u0b39 \u0b07\u0b28\u0b32\u0b3e\u0b07\u0b28\u0b30\u0b47 \u0b1f\u0b47\u0b15\u0b4d\u0b38\u0b1f\u0b4d \u0b2c\u0b1f\u0b28\u0b4d \u0b2c\u0b4d\u0b5f\u0b2c\u0b39\u0b3e\u0b30 \u0b15\u0b30\u0b28\u0b4d\u0b24\u0b41"},
gcF(){return"\u0b0f\u0b32\u0b3f\u0b2d\u0b47\u0b1f\u0b4d \u0b39\u0b4b\u0b07\u0b25\u0b3f\u0b2c\u0b3e \u0b2c\u0b1f\u0b28\u0b4d"},
gjS(){return"\u0b0f\u0b32\u0b3f\u0b2d\u0b47\u0b1f\u0b4d \u0b39\u0b4b\u0b07\u0b25\u0b3f\u0b2c\u0b3e \u0b2c\u0b1f\u0b28\u0b17\u0b41\u0b5c\u0b3f\u0b15 \u0b2a\u0b4d\u0b30\u0b3e\u0b5f \u0b38\u0b2e\u0b24\u0b33 \u0b32\u0b47\u0b06\u0b09\u0b1f\u0b17\u0b41\u0b5c\u0b3f\u0b15\u0b41 \u0b06\u0b15\u0b3e\u0b30 \u0b26\u0b47\u0b07\u0b25\u0b3e\u0b0f\u0964 \u0b38\u0b47\u0b17\u0b41\u0b5c\u0b3f\u0b15 \u0b2c\u0b4d\u0b5f\u0b38\u0b4d\u0b24 \u0b15\u0b3f\u0b2e\u0b4d\u0b2c\u0b3e \u0b1a\u0b09\u0b5c\u0b3e \u0b1c\u0b3e\u0b17\u0b3e\u0b17\u0b41\u0b5c\u0b3f\u0b15\u0b30\u0b47 \u0b2b\u0b19\u0b4d\u0b15\u0b38\u0b28\u0b17\u0b41\u0b5c\u0b3f\u0b15\u0b41 \u0b17\u0b41\u0b30\u0b41\u0b24\u0b4d\u0b71 \u0b26\u0b47\u0b07\u0b25\u0b3e\u0b0f\u0964"},
gd4(){return"\u0b06\u0b09\u0b1f\u0b32\u0b3e\u0b07\u0b28\u0b4d \u0b39\u0b4b\u0b07\u0b25\u0b3f\u0b2c\u0b3e \u0b2c\u0b1f\u0b28\u0b4d"},
gkM(){return"\u0b06\u0b09\u0b1f\u0b32\u0b3e\u0b07\u0b28\u0b4d \u0b39\u0b4b\u0b07\u0b25\u0b3f\u0b2c\u0b3e \u0b2c\u0b1f\u0b28\u0b17\u0b41\u0b5c\u0b3f\u0b15 \u0b26\u0b2c\u0b3e\u0b07\u0b32\u0b47 \u0b05\u0b38\u0b4d\u0b71\u0b1a\u0b4d\u0b1b \u0b39\u0b4b\u0b07\u0b2f\u0b3e\u0b0f \u0b0f\u0b2c\u0b02 \u0b09\u0b2a\u0b30\u0b15\u0b41 \u0b09\u0b20\u0b3f\u0b2f\u0b3e\u0b0f\u0964 \u0b0f\u0b15 \u0b2c\u0b48\u0b15\u0b33\u0b4d\u0b2a\u0b3f\u0b15, \u0b26\u0b4d\u0b71\u0b3f\u0b24\u0b40\u0b5f \u0b15\u0b3e\u0b30\u0b4d\u0b2f\u0b4d\u0b5f\u0b15\u0b41 \u0b38\u0b42\u0b1a\u0b3f\u0b24 \u0b15\u0b30\u0b3f\u0b2c\u0b3e \u0b2a\u0b3e\u0b07\u0b01 \u0b38\u0b47\u0b17\u0b41\u0b5c\u0b3f\u0b15\u0b41 \u0b05\u0b28\u0b47\u0b15 \u0b38\u0b2e\u0b5f\u0b30\u0b47 \u0b09\u0b2a\u0b30\u0b15\u0b41 \u0b09\u0b20\u0b3f\u0b25\u0b3f\u0b2c\u0b3e \u0b2c\u0b1f\u0b28\u0b17\u0b41\u0b5c\u0b3f\u0b15 \u0b38\u0b39 \u0b2a\u0b47\u0b5f\u0b3e\u0b30\u0b4d \u0b15\u0b30\u0b3e\u0b2f\u0b3e\u0b07\u0b25\u0b3e\u0b0f\u0964"},
gdk(){return"\u0b1f\u0b4b\u0b17\u0b32\u0b4d \u0b2c\u0b1f\u0b28\u0b4d\u200d\u0b17\u0b41\u0b5c\u0b3f\u0b15"},
gmn(){return"\u0b38\u0b2e\u0b4d\u0b2c\u0b28\u0b4d\u0b27\u0b3f\u0b24 \u0b2c\u0b3f\u0b15\u0b33\u0b4d\u0b2a\u0b17\u0b41\u0b5c\u0b3f\u0b15 \u0b17\u0b4b\u0b37\u0b4d\u0b20\u0b40\u0b2d\u0b41\u0b15\u0b4d\u0b24 \u0b15\u0b30\u0b3f\u0b2c\u0b3e \u0b2a\u0b3e\u0b07\u0b01 \u0b1f\u0b4b\u0b17\u0b32\u0b4d \u0b2c\u0b1f\u0b28\u0b4d\u200d\u0b17\u0b41\u0b5c\u0b3f\u0b15 \u0b2c\u0b4d\u0b5f\u0b2c\u0b39\u0b3e\u0b30 \u0b15\u0b30\u0b3e\u0b2f\u0b3e\u0b0f\u0964 \u0b38\u0b2e\u0b4d\u0b2c\u0b28\u0b4d\u0b27\u0b3f\u0b24 \u0b1f\u0b4b\u0b17\u0b32\u0b4d \u0b2c\u0b1f\u0b28\u0b4d\u200d\u0b17\u0b41\u0b5c\u0b3f\u0b15\u0b30 \u0b17\u0b4b\u0b37\u0b4d\u0b20\u0b40\u0b17\u0b41\u0b5c\u0b3f\u0b15\u0b41 \u0b17\u0b41\u0b30\u0b41\u0b24\u0b4d\u0b71 \u0b26\u0b47\u0b2c\u0b3e \u0b2a\u0b3e\u0b07\u0b01, \u0b17\u0b4b\u0b37\u0b4d\u0b20\u0b40 \u0b38\u0b2e\u0b3e\u0b28 \u0b15\u0b23\u0b4d\u0b1f\u0b47\u0b28\u0b30\u0b4d \u0b38\u0b47\u0b5f\u0b3e\u0b30\u0b4d \u0b15\u0b30\u0b3f\u0b2c\u0b3e \u0b09\u0b1a\u0b3f\u0b24"},
gbz(){return"\u0b2b\u0b4d\u0b32\u0b4b\u0b1f\u0b3f\u0b02 \u0b06\u0b15\u0b4d\u0b38\u0b28\u0b4d \u0b2c\u0b1f\u0b28\u0b4d"},
